import React from 'react';
import styles from './styles.module.scss'

const Sidebar = ({ tabs }) => {

  return (
    <div className={styles.sidebar}>
      <h1>Fenris</h1>
      <hr />

      <div className={styles.credits}>
        By <a href="https://jbecker.dev">Jonathan Becker</a>
      </div>
    </div>
  );

};

export default Sidebar;
